import React from "react";

export default function Data() {
    return (
        <div className="home_data">
            <h1 className="home_title">
                Richard Jean-Baptiste
            </h1>

            <h3 className="home_subtitle">Software Developer</h3>
            <p className="home_description">I'm a software engineer currently based in The Big apple. I'm a passionate coder who wants to create technology that helps to elevate and connect people and push technology forward as a whole. Some technologies I currently enjoy working with are React/React-Native , Python/Flask, and MongoDB</p>
            <a href="#contact" className="button button--flex">
                Say Hello

                <i class="uil uil-message"></i>
            </a>
        </div>
    )
}
